    <title>Glowlinks |DDarkweb</title>
    
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link href="https://fonts.googleapis.com/css2?family=Archivo+Black&family=Inter:wght@300;400;700&display=swap" rel="stylesheet">

    <style>
        :root {
            --glow-red: #ff0000;
            --deep-red: #8b0000;
            --gold-premium: #ffcc00;
            --bg-dark: #050505;
        }

        body {
            margin: 0;
            padding: 0;
            font-family: 'Inter', sans-serif;
            background: var(--bg-dark);
            background-image: 
                radial-gradient(circle at 50% -20%, rgba(229, 9, 20, 0.2) 0%, transparent 50%),
                url('https://www.transparenttextures.com/patterns/asfalt-dark.png');
            color: #fff;
            display: flex;
            flex-direction: column;
            align-items: center;
            min-height: 100vh;
            overflow-x: hidden;
        }

        .rating {
            position: absolute;
            top: 20px;
            left: 20px;
            border: 2px solid #fff;
            padding: 4px 12px;
            font-size: 1rem;
            font-weight: 900;
            letter-spacing: 1px;
            background: rgba(0,0,0,0.5);
            z-index: 10;
        }

        .ad-tray {
            margin-top: 80px; /* Space for the rating tag */
            width: 90%;
            max-width: 1400px;
            padding-bottom: 20px;
        }

        .ad-label {
            font-size: 0.8rem;
            color: var(--gold-premium);
            text-transform: uppercase;
            letter-spacing: 3px;
            margin-bottom: 20px;
            text-align: center;
            font-weight: 900;
        }

        .ad-container {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
            gap: 20px;
            perspective: 1000px;
        }

        .ad-box {
            position: relative;
            border-radius: 12px;
            overflow: hidden;
            border: 2px solid #222;
            transition: all 0.5s ease;
            cursor: pointer;
        }

        .ad-box::after {
            content: '';
            position: absolute;
            top: -50%; left: -50%;
            width: 200%; height: 200%;
            background: linear-gradient(45deg, transparent, rgba(255,255,255,0.1), transparent);
            transform: rotate(45deg);
            transition: 0.5s;
        }

        .ad-box:hover {
            transform: rotateY(5deg) scale(1.05);
            border-color: var(--gold-premium);
            box-shadow: 0 20px 50px rgba(255, 204, 0, 0.2);
        }

        .ad-box:hover::after {
            left: 100%;
        }

        .ad-box img {
            width: 100%;
            height: auto;
            display: block;
        }

        .hero {
            text-align: center;
            padding: 20px 20px 40px;
            z-index: 2;
        }

        h1 {
            font-family: 'Archivo Black', sans-serif;
            font-size: clamp(4rem, 15vw, 9rem);
            text-transform: uppercase;
            margin: 0;
            letter-spacing: -4px;
            line-height: 0.9;
            background: linear-gradient(to bottom, #fff 30%, #444 100%);
            -webkit-background-clip: text;
            -webkit-text-fill-color: transparent;
            filter: drop-shadow(0 0 20px rgba(255, 255, 255, 0.2));
        }

        .meta-data {
            margin: 20px 0;
            font-weight: 700;
            font-size: 1rem;
            color: #888;
        }

        .meta-data span.match { color: #46d369; margin-right: 15px; }

        .btn-onion {
            background: #fff;
            color: #000;
            padding: 20px 50px;
            font-size: 1.2rem;
            font-weight: 800;
            text-decoration: none;
            border-radius: 5px;
            display: inline-flex;
            align-items: center;
            gap: 12px;
            transition: all 0.4s cubic-bezier(0.175, 0.885, 0.32, 1.275);
            animation: pulse-glow 2s infinite;
        }

        @keyframes pulse-glow {
            0% { box-shadow: 0 0 0 0 rgba(255, 255, 255, 0.4); }
            70% { box-shadow: 0 0 0 20px rgba(255, 255, 255, 0); }
            100% { box-shadow: 0 0 0 0 rgba(255, 255, 255, 0); }
        }

        .glow-links-status {
            margin-top: 40px;
            text-align: center;
            background: rgba(255,255,255,0.03);
            padding: 40px;
            border-radius: 20px;
            width: 80%;
        }

        .status-badge {
            display: inline-block;
            padding: 5px 15px;
            border-radius: 50px;
            background: #333;
            font-size: 0.7rem;
            text-transform: uppercase;
            margin-bottom: 15px;
            color: #aaa;
        }

        .status-badge.blink {
            animation: blinker 1.5s linear infinite;
            color: #ff4444;
        }

        @keyframes blinker { 50% { opacity: 0; } }

        .footer {
            margin: 60px 0;
            color: #333;
            font-size: 0.7rem;
            letter-spacing: 2px;
        }
    </style>
</head>
